import { NgModule } from '@angular/core';
import { ReactiveFormsModule } from '@angular/forms';
import { CommonModule } from '@angular/common';


import { AbonnementRoutingModule } from './abonnement-routing.module';
import { AbonnementListComponent } from './abonnement-list/abonnement-list.component';
import { AbonnementCreateComponent } from './abonnement-create/abonnement-create.component';
import { AbonnementUpdateComponent } from './abonnement-update/abonnement-update.component';
import { AbonnementDeleteComponent } from './abonnement-delete/abonnement-delete.component';



@NgModule({
  declarations: [
    AbonnementListComponent,
    AbonnementCreateComponent,
    AbonnementUpdateComponent,
    AbonnementDeleteComponent


  ],
  imports:[
    CommonModule,
    AbonnementRoutingModule,
    ReactiveFormsModul
  ]
})
export class AbonnementModule { }
